$.arl=A.b(["Ditengah realitas persoalan masyarakat Kabupaten Pamekasan terkait munculnya paham-paham yang beragam seperti syiah, wahabi dan lain-lain maka sangat perlu untuk memperkuat pemahaman para anggota dan kader PMII Komisariat UNIRA dengan diadakannya kajian bertemakan Ahlussunnah waal-Jama\u2019ah. Aswaja memang begitu penting sebagai manhaj al-fikr dan manhaj al-harakah untuk diperdalam pemahamannya kepada 3 rayon dalam naungan PMII Komisariat UNIRA. Pemateri dalam kajian Aswaja adalah seorang senior PMII yang memang gerak juangnya dalam lingkup organisasi yang bernafaskan Nahdlatul Ulama yakni Bapak Fathorrahman, S.E.,M.M. atau sering disapa dengan sebutan Bapak Pa\u2019ong, dalam kajiannya beliau menjelaskan bahwa tiga kategori yang akan dipaparkan yakni dari segi teologi, hukum dan tasawuf. Dari segi teologi yang mana pendekatan tersebut merupakan ilmu yang membicarakan tentang Tuhan dan pertaliannya dengan manusia, baik berdasarkan kebenaran wahyu ataupun berdasarkan penyelidikan akal murni, sehingga dalam penjelasannya dikaitkan dengan Tauhid dan Ilmu Aqoid. Dan dari segi hukum, pemateri memetakkan menjadi 3 lini yakni dari segi Ubudiyah, Muamalah dan Politik, dan dari segi tersebut yang membedakan adalah fiqh siasahnya dan bagi aswaja proses paling penting menuju ghayah (tujuan), dan politik adalah wasilah. Dan satu hal yang sangat melekat pada ingatan penulis adalah bahwa Ahlussunnah waal-Jama\u2019ah tidak mengklaim kebenaran dari diri kita melainkan dari Allah S.W.T. sehingga bagi ummat yang mengaku Aswaja namun merasa paling benar, maka patut dipertanyakan keaswajaannya.","Literasi digital di Era Digitalisasi sangatlah dibutuhkan, sebab era tersebut bagaikan dua mata pisau yang kegunaannya akan bergantung pada siapa pemakainya, begitu pula dengan tekhnologi atau biasa kita sebut dalam dunia maya, kebermanfaatan penuh akan kita dapatkan apabila kita bisa memanfaatkan peluang dengan baik, banyak orang yang menginginkan sebuah tujuannya tercapai namun tidak segera mengambil langkah dalam mencapai kesuksesan itu, pernyataan-pernyataan tersebut adalah bagian kecil dari materi yang serat akan daging ilmu yang disampaikan oleh Pemateri, Khairul umam,M.Pd. atau yang disapa dengan Kak Umam, Pemateri merupakan senior PMII yang berkecimpung di dunia akademisi yaitu menjadi seorang dosen di salah universitas di Pamekasan, wartawan dan juga pengusaha. Pemateri juga menyampaikan berbagai informasi terkait dengan pekerjaan-pekerjaan yang berhubungan dengan digital atau tekhnologi, hanya saja untuk mencapai kesuksesan tersebut perlu tekad yang bulat sampai tercapainya sebuah tujuan, dikarenakan dalam dunia digital dituntut untuk mendorong bertumbuhnya kreatifitas diri maupun kreatifitas komunitas itu sendiri, hanya saja perlu untuk tetap mengimbangi dalam etika digital.","Salah satu kunci vital keberhasilan sebuah organisasi adalah dari kepemimpinannya, sebab segala keputusan, pergerakan dan laju perkembangan sepenuhnya dikendalikan oleh seorang pemimpin, maka peran vital kepemimpinan dalam organisasi tersebut dipaparkan dalam kajian kolaboratif 3 Rayon dibawah naungan Komisariat UNIRA, disampaikan oleh pemateri yang tentunya telah terbukti berhasil dalam memimpin sebuah organisasi seperti Ketua Rayon Khalid bin Walid pada masanya selain itu beliau adalah satu-satunya kader PMII yang berhasil menjadi mahasiswa pertukaran pelajar ke Negeri Gajah Putih yakni Thailand. Dalam pemaparannya pemateri menjelaskan kepemimpinan mulai dari kepemimpinan diri hingga mitos dan fakta dalam bagaimana terwujudnya kepemimpinan itu sendiri. Terdapat beberapa mitos dan fakta yang sengaja dibuat mengambang agar para audiens yang sebagian besar adalah anggota ketiga Rayon dan juga kepengurusan rayon yang mendampingi terbuka pemikirannya dan menyelaraskan sesuai dengan daya logika dan berfikir masing-masing. Seperti mitos dan fakta pertama bahwa kepemimpinan itu dilahirkan, yang kedua yaitu pemimpin harus dibentuk dan yang terakhir, justru dikatakan bahwa kepemimpinan lebih mengarah pada emosionalnya, dan dari ketiga hal tersebut audiens diminta untuk memiliki pemikirannya tersendiri, pernyataan yang mana mengandung mitos ataupun fakta dikorelasikan dengan fakta yang terjadi di kehidupan sehari-hari. Selain itu juga dijelaskan fungsi dari kepemimpinan yakni perencanaan, penetapan visi, pengembangan loyalitas dan pengambil keputusan dan dijelaskan pula tipe-tipe kepemimpinan yang terdiri dari Demokratis, Karismatik, Otoriter, Birokratif dan transaksional, materi-materi disampaikan dengan cara sangat interaktif sehingga audiens juga tidak canggung dalam menyampaikan segala aspirasinya terkait dengan materi-materi diatas, hingga sampai dipenghujung waktupun audiens tidak merasa bosan karena metode penyampaian yang disampaikan benar-benar menunjukkan bagaimana jiwa kepemimpinan itu telah berhasil melekat dalam diri pemateri.","Pengurus Besar Pergerakan Mahasiswa Islam Indonesia (PB PMII) menggelar Kick Off 63 Tahun PMII di Sekretariat PB PMII, Jl. Salemba Tengah, Senen, Jakarta Pusat, Sabtu (1/4/2023).\nKegiatan Kick Off menandai dimulainya rangkaian Harlah 63 Tahun PMII yang akan di pusatkan di Jawa Tengah Juni 2023 mendatang, sekaligus menjadi pengantar dimulainya lima agenda utama Harlah 63 Tahun PMII yaitu :\n","Bertepatan pada tanggal 29 Maret 2023, Muslimat Nahdlatul Ulama (NU) genap berumur 77 tahun. Di umurnya yang makin matang tersebut, Ketua Pimpinan Pusat (PP) Muslimat Nahdlatul Ulama (NU) Khofifah Indar Parawansa menegaskan kalau","Ciputat \u2013 Guna meningkatkan kualitas kader, PMII Komfuspertum (Komisariat Fakultas Ushuluddin dan Perguruan Tinggi Umum) Cabang Ciputat mengadakan kegiatan Manajemen Organisasi Kepemimpinan (MOK) sekaligus buka puasa bersama. Bertempat di Aula IMM, Ciputat, Tangerang"],t.s)
